(window.webpackJsonp=window.webpackJsonp||[]).push([[673],{1027:function(n,h,t){"use strict";t.r(h);var c=t(44),i=Object(c.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-tieu-cong-chua-su-tinh"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-tieu-cong-chua-su-tinh"}},[n._v("#")]),n._v(" Chương: Tiểu công chúa sự tình")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Bốn chương một vạn chữ đã đổi mới, thuận tiện giải thích tiểu công chúa sự tình."),t("br"),t("br"),n._v("Bốn chương một vạn chữ đã đổi mới, tiếp tục cầu nguyệt phiếu!"),t("br"),t("br"),n._v("Nhìn thấy ngày hôm qua chương tiết cùng, mọi người triệt để nổ tung, không tới một ngày, một cái hai ngàn người nhóm, cũng nhanh tăng max, chỗ bình luận truyện, không ít người đọc đều tại nhắn lại, nói lão nhai là hồ viết, Lạc Thất Thất thế nào lại là tiểu công chúa, phía trước không có một chút báo hiệu!"),t("br"),t("br"),n._v("Vì chứng thực lão nhai không phải Hồ viết, mọi người có thể chú ý ta công chúng số, Wechat lục soát “Hoành Tảo Thiên Nhai”, kiểm tra trong đó lịch sử tin tức, ngày 23 tháng 3, lão nhai phát qua một cái  tiếp xuống mấy cuốn. Liền ghi chú rõ cái này cuốn là Trương Huyền cự hôn (từ hôn)."),t("br"),t("br"),n._v("Cũng có người đọc tại mấy tháng trước liền đoán được, hơn nữa còn phát thiếp mời, mọi người tìm không thấy có thể thêm nhóm: 815276127, bên trong có không ít lợi hại người đọc, đã tìm tới, hơn nữa còn dự đoán đi ra."),t("br"),t("br"),n._v("Còn phục bút, lão nhai lưu lại rất nhiều, có thể bày ra thoáng cái, mọi người không tin, có thể đi trở về tìm kiếm."),t("br"),t("br"),n._v("1, Lạc Nhược Hi là Lạc gia tiểu công chúa, là tại Khưu Ngô cung thời điểm, người khác phỏng đoán, Lạc Nhược Hi chưa hề nói qua, Trương Huyền cũng chưa từng hướng nàng tự thân xác nhận qua."),t("br"),t("br"),n._v("2, Lạc Nhược Hi từng chuyên môn nói qua, bản thân không phải Lạc gia người."),t("br"),t("br"),n._v("3, từ khi Trương Huyền biết “Lạc Nhược Hi là tiểu công chúa” cái này giả đầu đề về sau, toàn văn chưa hề đề cập qua Lạc Nhược Hi tên, tình huống bình thường đều dùng tiểu công chúa thay thế. Lạc Huyền Thanh xưng hô: Muội muội, cũng chưa từng nói qua tên."),t("br"),t("br"),n._v("4, Lạc Huyền Thanh từng nói qua, bản thân có năm cái ca ca, tất cả đều chết rồi. Tiểu công chúa xếp hạng thứ bảy (lớn phục bút)."),t("br"),t("br"),n._v("5, Lạc Huyền Thanh từng nói, muội muội không am hiểu luyện đan."),t("br"),t("br"),n._v("6, Lạc Thất Thất tại Thanh Nguyên trước thành chân vừa đi, Lạc Thừa Tân liền đến tìm Trương Huyền phiền phức."),t("br"),t("br"),n._v("7, Ngọc Phi Nhi là Lạc Thất Thất hảo hữu, lại nhận được cửu tinh danh sư đồng ý, bản thân liền không bình thường."),t("br"),t("br"),n._v("8, Ngọc Phi Nhi biết Trương Huyền là tiểu thiên tài lúc, mười phần khiếp sợ. Nguyên văn là: Ngọc Phi Nhi vội vàng xé ra, nhìn một cái, lập tức thân thể cứng đờ. “Hắn là Trương gia tiểu thiên tài, chẳng phải chứng tỏ...”, nói rõ nàng lúc này đã biết, là chịu Lạc Thất Thất ân huệ. Hơn nữa lúc trước, Trương Huyền từng nói với Ngọc Phi Nhi, hắn ưa thích chính là Lạc gia tiểu công chúa."),t("br"),t("br"),n._v("9, Thánh tử điện tiểu công chúa rời đi, chừng tám, chín tháng, trong lúc đó Lạc Thất Thất tại Hồng Viễn danh sư học viện tấn thăng đến ngũ tinh danh sư, trở thành năm thứ hai học sinh, cũng không xung đột."),t("br"),t("br"),n._v("10, Lạc Nhược Hi Khưu Ngô cung, cũng không dùng Tĩnh Không châu, chỉ là thi triển không gian lực lượng, không gian lực lượng, tu vi đạt tới Vũ Không cảnh, không ít người đều sẽ sử dụng, nói rõ không được cái gì."),t("br"),t("br"),n._v("11, Lạc Nhược Hi tính cách lạnh nhạt, Khưu Ngô cung danh sư chết trận, nàng đều chẳng muốn ra tay, chỉ cứu Trương Huyền. Tiểu công chúa tâm tư cẩn thận, thậm chí còn năn nỉ ca ca bảo vệ Trương Huyền. Hai người tính cách rõ ràng khác biệt."),t("br"),t("br"),n._v("12, tiểu công chúa thành thân phía trước, lo được lo mất, phía dưới là nguyên văn: “Đúng rồi... Ta cho các ngươi hỏi thăm sự tình, hỏi thăm sao? Trương sư, hắn... Hôm qua đi tới, có hay không nói cái gì?” Đột nhiên, nghĩ đến cái gì, tiểu công chúa có chút khẩn trương nhìn qua. “Cái này...” Hầu gái sửng sốt một chút, vừa định nói chuyện, liền nghe phía ngoài tiếng bước chân vang lên, ngay sau đó một cái cởi mở tiếng cười vang lên: “Không cần hỏi các nàng, ta đã giúp ngươi hỏi thăm!”"),t("br"),t("br"),n._v("“Thiếu gia!”"),t("br"),t("br"),n._v("Nhìn thấy người này, hầu gái vội vàng khom người."),t("br"),n._v(" “Ừm!”"),t("br"),t("br"),n._v("Lạc Huyền Thanh khoát tay áo, nhìn về phía trước mắt muội muội, cười ha ha một tiếng: “Hôm qua ta gặp được tiểu tử kia, vừa nghe đến ngươi, kích động cực kỳ, nhất định phải tới, nếu không phải ta lôi kéo, khẳng định đều xông lại!”"),t("br"),t("br"),n._v("“Hắn... Kích động cực kỳ?”"),t("br"),t("br"),n._v("Tiểu công chúa hơi đỏ mặt: “Ca ca, đừng giễu cợt muội muội! Ngươi xác định nói với hắn rõ ràng là ta?” Nếu như là Lạc Nhược Hi, hai người rõ ràng tình lữ quan hệ, chắc chắn sẽ không có này lo lắng. Lạc Thất Thất thổ lộ bị từ chối, mới có thể nghĩ như vậy."),t("br"),t("br"),n._v("13, còn, Tĩnh Không châu tại sao lại phong ấn một bộ phận ký ức, để Thất Thất vừa mới bắt đầu thoạt nhìn có chút không phù hợp thân phận, lớn phục bút, dính dáng đằng sau một cái rất lớn kịch bản, tạm thời không tiện tiết lộ. Thư viện vì sao nhìn không thấu, lý do giống như trên."),t("br"),t("br"),n._v("14, Trương Huyền cùng Lạc Huyền Thanh tìm kiếm Động Hư hồ lô lúc, nói nơi này là tiểu công chúa căn cứ địa cầu đoán ra được, lúc ấy, Trương Huyền trong lòng cảm xúc, loại này chỉ bằng vào nhìn địa đồ liền đoán ra được năng lực, cùng Lạc Thất Thất có chút tương tự."),t("br"),t("br"),n._v("15, Lạc Thất Thất từ Thanh Nguyên thành lúc gần đi, từng nói qua, mình thích ngồi tại nóc phòng, từ nhỏ mười phần cố gắng, thiên tư thông minh. Lạc Huyền Thanh từng nói qua, muội muội của hắn mười phần cô độc, mỗi lần ban đêm, đều một người ngồi tại nóc phòng."),t("br"),t("br"),n._v("Nguyên văn: “Không có gì, chỉ là nhớ tới khi còn bé một số việc.”"),t("br"),t("br"),n._v("Nở nụ cười, Lạc Thất Thất yên tĩnh nhìn về phía trước Thanh Nguyên thành: “Ta khi còn bé, thích nhất làm, chính là lúc rảnh rỗi, ngồi tại nóc phòng, xem mặt trời mọc, mặt trời lặn, bốn phía phi hành chim tước... Cảm thấy thật vui vẻ.”"),t("br"),t("br"),n._v("Phía dưới là Lạc Huyền Thanh lời nói: “Muội muội ta bởi vì thiên tài quang hoàn, từ nhỏ đến lớn, đều không có bằng hữu gì... Toàn cả gia tộc người, tuy là đều đối nàng kính trọng, không dám phản bác, trên thực tế lại tương đương đem cô lập... Mỗi lần ban đêm, cũng có thể thấy nàng một người ngồi tại trên nóc nhà, nhìn lấy bầu trời đầy sao, không nói ra được cô độc.”"),t("br"),t("br"),n._v("Được rồi, trước nói nhiều như vậy đi, còn có không ít phục bút, chính ta đều quên. Mồ hôi!"),t("br"),t("br"),n._v("Không tin, có thể đi xem đại cương. Lão nhai là thật có đại cương."),t("br"),t("br"),n._v("Liên quan tới Lạc Nhược Hi thân phận, mọi người đừng loạn đoán, đằng sau sẽ từng tầng từng tầng mở ra. Trong đó đảo ngược, có thể sẽ để mọi người tiếp tục thổ huyết. Còn có, viết xong  cái kia cuốn lúc, ta từng nói qua, cái này cuốn dính dáng rất lớn, lão nhai bày rất nhiều phục bút. Tiểu công chúa cái này chỉ là một trong số đó. Còn có ít nhất ba chỗ lớn phục bút, siêu cấp lớn cái loại này, so Lạc Thất Thất là tiểu công chúa còn lớn hơn, bây giờ còn chưa người nhìn ra được, hi vọng mọi người có thể cẩn thận tìm kiếm."),t("br"),t("br"),n._v("Mặt khác, trong đám có nguyệt phiếu rút thưởng hoạt động, ném nguyệt phiếu càng nhiều, phần thưởng càng phong phú, cho quyển sách ném qua nguyệt phiếu thư hữu, mọi người có thể nhanh đi tham gia. Dù sao đều đã ném, ngộ nhỡ nhận được phần thưởng đâu? Không phải trắng kiếm sao? Ha ha!"),t("br"),t("br"),n._v("Phần thưởng, không chỉ có kí tên thực thể sách, còn có đủ loại xung quanh vật kỷ niệm, áo, chén trà, quạt xếp các loại, phía trên có cartoonist vẽ Trương Huyền chân dung, mười phần tinh xảo, mọi người có thể đi tham gia."),t("br"),t("br"),n._v("Nhóm số: 322239813"),t("br"),t("br"),n._v("Cuối cùng, tiếp tục cầu nguyệt phiếu."),t("br"),t("br"),n._v("Có phiếu đừng quên ném, đằng sau truy rất căng, lão nhai tháng này, muốn đệ nhất! Xin nhờ!"),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1591"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1593"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=i.exports}}]);